let allCities;

const CitiesAndCodes = () => {
  fetch("http://localhost:3000/", {
    method: "GET",
    headers: { "Content-Type": "application/json" },
  })
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      allCities = data;
    })
    .catch((error) => {
      console.error("Error fetching data:", error);
    });
};

export default CitiesAndCodes;
